CREATE SCHEMA IF NOT EXISTS disney DEFAULT CHARACTER SET latin1 ;
USE disney ;

CREATE TABLE IF NOT EXISTS disney_stocks (
     date  DATETIME,
     open  NUMERIC(7, 4),
     high  NUMERIC(7, 4),
     low  NUMERIC(7, 4),
     close  NUMERIC(7, 4),
     volume  INT
);

    
SELECT * FROM disney_stocks
